import React from 'react'
import { useState } from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCog } from '@fortawesome/free-solid-svg-icons'

const Setings = () => {
    const [seting, setSeting] = useState(false)

    const mouseHandler = () => {
        if(seting === false){
          setSeting(true)
        }else{
          setSeting(false)
        }
        console.log(seting)
      }


    return (
        <div>
            <div className='setings'>
                <FontAwesomeIcon icon={faCog} size="1x" onClick={mouseHandler} />
            </div>
            {seting &&
            <div className='seting-s' onMouseLeave={mouseHandler}>
                <div className='seting-icon'>
                    <p>Temperature</p><span>°C</span><span>°K</span>
                    <p>Speed</p><span>km/h</span>
                </div>
            </div>}
        </div>
    )
}

export default Setings
